-- Triggers `lzafield`
--
DROP TRIGGER IF EXISTS `lzafield__id`;
DELIMITER $$
CREATE TRIGGER `lzafield__id` BEFORE INSERT ON `lzafield` FOR EACH ROW BEGIN IF NEW.id IS NULL OR NEW.id = '' THEN SET NEW.id = UUID(); END IF; SET @last_uuid = NEW.id; END
